import { Helpers, PageMain, SimpleGrid, TextBox, DatePicker, DropDown, Delimiter } from "core";
import React, { Component } from "react";
import NotificationSystem from "react-notification-system";
import Constants from "../../../utils/constants"
import { Backward, GetUrl } from "../../../utils/generals";
import RequestListSection from '../../../sections/requestListSection'

export default class RequstBranchStrListPage extends Component {
    constructor(props) {
        super(props);

        this.state = {
            isLoading: false,
        };

        this.notificationSystem = React.createRef();
    }

    render() {
        return (
            <>
                <PageMain context={ this } title="فهرست درخواست دانلود گزارش STR" icon="list-search" isLoading={ this.state.isLoading }
                    footerLinks={[{ href: "/", text: "صفحه اصلی" }]} key={ this.state.filterUpdate }
                    topButtons={[
                        {
                            title: "فهرست درخواست ثبت STR پولشویی",
                            url: GetUrl("registerStrListPage"),
                            color: "outline-primary",
                            icon: "list-search",
                        }
                    ]}>
                        <RequestListSection notificationSystem={ this.notificationSystem } title="جزئیات فهرست درخواست دانلود گزارش STR" requestTypeId= { Constants.RequestType.DownloadReport_STR }/>
                </PageMain>
                <NotificationSystem ref={ this.notificationSystem } />
            </>
        );
    }
}
